import React from "react";
import Avatar from 'react-avatar';

function Page1() {
    return (
        <div className="containr-fluid">
            <div className="row flex-noerap">
                <div className="col-auto col-md-3 col-xl-2 px-sm-2 px-0" style={{ backgroundColor: '#09979B' }}>
                    <div className="d-flex flex-column align-items-center align-items-sm-start px-3 pt-2 text-white min-vh-100">
                        <a href="/" className="d-flex align-items-center pb-3 mb-md-0 me-md-auto text-white text-decoration-none">
                            <i className="fa fa-arrow-left" style={{ fontSize: '30px', color: 'white' }} />&nbsp;&nbsp;
                            
                            <h1 style={{ paddingTop: '10px', paddingBottom: '10px', fontWeight: 'bold', fontSize: '20px' }}><span className="d-none d-sm-inline">ELEcREc</span></h1>
                        </a>
                    </div>
                </div>
                <div>
                    <Avatar googleId="118096717852922241760" size="100" round={true}  />
                    <p align="center" style={{ paddingTop: '10px', paddingBottom: '10px', color: '#ffcb42', fontWeight: 'bold', fontSize: '25px' }}>Shop name</p>
                </div>

                
            </div>
        </div>
    )
}

export default Page1
